$(function(){
    // table row
    $('tr[data-href] td').dblclick(function(e){
        window.location = $(this).parent().attr('data-href');
        e.stopPropagation();
    })

    // datepicker
    $( "input[name*=date]" ).datepicker({dateFormat:"dd/mm/yy", showOtherMonths: true, selectOtherMonths: true, dayNamesMin: [ "Di", "Lu", "Ma", "Me", "Je", "Ve", "Sa" ], firstDay: 1});
    $( "input[name*=birthday]" ).datepicker({dateFormat:"dd/mm/yy", changeMonth: true, changeYear: true, maxDate: "-10y", yearRange: "-40:-10", dayNamesMin: [ "Di", "Lu", "Ma", "Me", "Je", "Ve", "Sa" ], firstDay: 1});

    // countdown
    if(typeof target != 'undefined')
        $('#countdown').countdown({until: target});

    // checkall
    var check_btn = $('<div class="check-all"><i class="icon-check"></i> Tout cocher</div>');
    check_btn.click(function(){
        $(this).parent().find('input[type=checkbox]').attr('checked', true);
    });

    $('.staked-checkboxes').prepend(check_btn);

    // auto select
    $(".auto-select").focus(function() {
        var $this = $(this);
        $this.select();

        // Work around Chrome's little problem
        $this.mouseup(function() {
            $this.unbind("mouseup");
            return false;
        });
    });

    // extra fields
    var main_container = $('#hflan_lanbundle_tournament_extraFields');
    var add_btn = $('<button type="button" class="btn"><i class="icon-plus"></i> Ajouter un champ</button>');
    var index = main_container.children('.control-group').length;

    main_container.append(add_btn);
    add_btn.click(add_form);

    main_container.children('.control-group').each(function() {
        add_remove($(this));
    });

    function add_form(){
        var html = main_container.attr('data-prototype')
            .replace('<label class="control-label required">__name__label__</label>', '')
            .replace(/__name__/g, index);
        var $prototype = $(html);
        add_remove($prototype);

        add_btn.before($prototype);
        ++index;
    }

    function add_remove(elem){
        var remove_btn = $('<div class="remove-form"><i class="icon-remove"></i></div>');

        remove_btn.click(function(){
            $(this).parent().animate({opacity:0}, 400, function(){
                $(this).remove();
            });
        })

        elem.prepend(remove_btn);
    }
});
$(function(){
    var interval = 7000;
    var carouselNext = function($carousel){
        var $prev = $carousel.find('.current');
        var $current = $carousel.find('.next');

        $carousel.find('article').removeClass();
        $prev.addClass('prev');
        $current.addClass('current');

        var $next = $current.next('article');
        if(!$next.length)
            $next = $carousel.find('article:first');
        $next.addClass('next');
    }

    var autoPlay = function(){
        $('.carousel').each(function(){
            if($(this).attr('data-autoplay') == 'true' && $(this).attr('data-paused') == 'false'){
                carouselNext($(this));
                setTimeout(autoPlay, interval);
            }
        });
    }
    setTimeout(autoPlay, interval);

    $('.carousel .nav-next').click(function(){
        carouselNext($(this).parent());
    });

    $('.carousel .nav-prev').click(function(){
        var $next = $(this).nextAll('.current');
        var $current = $(this).nextAll('.prev');

        $(this).nextAll('article').removeClass();
        $next.addClass('next');
        $current.addClass('current');

        var $prev = $current.prev('article');
        if(!$prev.length)
            $prev = $current.parent().find('article:last');
        $prev.addClass('prev');
    });

    $('.carousel').mouseenter(function(){
        $(this).attr('data-paused', 'true');
        $(this).attr('data-hover', 'true');
    })

    $('.carousel').mouseleave(function(){
        var $this = $(this);
        $this.attr('data-hover', 'false');
        setTimeout(function(){
            if($this.attr('data-paused') == 'true' && $this.attr('data-hover') == 'false'){
                $this.attr('data-paused', 'false');
                autoPlay();
            }
        }, interval);
    })
});
$(function(){
    $('*[data-sortable]').click(function(e){
        e.preventDefault();
        var $this = $(this);
        var $row = $this.parent().parent();
        var dir = $this.attr('data-sortable');

        $.get($this.attr('href'));

        if(dir == 'up'){
            if(!$row.prev().find('th').length)
                $row.after($row.prev());
        }
        else
            $row.before($row.next());
    })
});
$(function(){
    $('.tabs .tab').click(function(e){
        var $this = $(this);
        $this.siblings().removeClass('active');
        $this.addClass('active');

        e.preventDefault();

        var target = $($this.attr('href'));
        target.attr('id','');
        window.location.hash = $this.attr('href');
        target.attr('id',$this.attr('href').replace('#', ""));
        target.siblings().removeClass('active');
        target.addClass('active');
    });

    if(window.location.hash.replace('#', '') == ''){
        $('.tabs .tab:first').addClass('active');
        $('.tab-content .tab-container:first').addClass('active');
    }
    else{
        $('.tabs .tab[href='+window.location.hash+']').addClass('active');
    }
});